export function Name() { return "Alienware AW3225QF"; }
export function VendorId() { return 0x187c; }
export function ProductId() { return 0x1013; }
export function Publisher() { return "Fefe_du_973"; }
export function Size() { return [80, 35]; }
export function DefaultPosition() { return [10, 100]; }
export function DefaultScale() { return 8.0 }
export function ControllableParameters() {
  return [
    { "property": "shutdownColor", "group": "lighting", "label": "Shutdown Color", "min": "0", "max": "360", "type": "color", "default": "009bde" },
    { "property": "LightingMode", "group": "lighting", "label": "Lighting Mode", "type": "combobox", "values": ["Canvas", "Forced"], "default": "Canvas" },
    { "property": "forcedColor", "group": "lighting", "label": "Forced Color", "min": "0", "max": "360", "type": "color", "default": "009bde" },
  ];
}

let vLedIDs = [
  0x01, 0x02, 0x08
];

var vLedNames = [
  "Alien", "Number", "Switch"
];

var vLedPositions = [
  [57, 17], [23, 17], [75, 30]
];


export function LedNames() {
  return vLedNames;
}

export function LedPositions() {
  return vLedPositions;
}

export function Initialize() {
  let packet = [];
  packet[1] = 0x92;
  packet[2] = 0x37;
  packet[3] = 0x05;
  packet[4] = 0x00;
  packet[5] = 0x51;
  packet[6] = 0x82;
  packet[7] = 0xd0;
  packet[8] = 0xf4;
  packet[9] = 0x99;
  device.write(packet, 65);
}

export function Render() {
  sendColors();
}

export function Shutdown() {
  sendColors(true);
}

function fillInChecksum(packet) {
  let checksum = 110;
  for (let index = 5; index <= 13; index++) {
    checksum ^= packet[index];
  }
  packet[14] = checksum;
}

function sendColors(shutdown = false) {
  let packet = new Array(65).fill(0xFF);

  packet[1] = 0x92;
  packet[2] = 0x37;
  packet[3] = 0x0a;
  packet[4] = 0x00;
  packet[5] = 0x51;
  packet[6] = 0x87;
  packet[7] = 0xd0;
  packet[8] = 0x04;

  for (let idx = 0; idx < vLedIDs.length; idx++) {
    let iPxX = vLedPositions[idx][0];
    let iPxY = vLedPositions[idx][1];
    let iLed = vLedIDs[idx];
    let color;

    if (shutdown) {
      color = hexToRgb(shutdownColor);
    } else if (LightingMode === "Forced") {
      color = hexToRgb(forcedColor);
    } else {
      color = device.color(iPxX, iPxY);
    }

    packet[9] = iLed;
    packet[10] = color[0];
    packet[11] = color[1];
    packet[12] = color[2];
    packet[13] = 0x64;

    fillInChecksum(packet);

    device.write(packet, 65);
  }
}


function hexToRgb(hex) {
  let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  let colors = [];
  colors[0] = parseInt(result[1], 16);
  colors[1] = parseInt(result[2], 16);
  colors[2] = parseInt(result[3], 16);

  return colors;
}

export function Validate(endpoint) {
  return endpoint.interface === 0 && endpoint.usage === 0x0001 && endpoint.usage_page === 0xff00;
}

export function Image() {
  return "";
}